import React from "react";
import Contact from "../image/contact.svg";


const Login_card = () =>{
    return (
        <>
        
        <div className="col-lg-8 mx-auto">
                            <img src={Contact} className="img-fluid" alt="not found" />
                        </div>

        </>
    )
}


export default Login_card;
